INSERT INTO `flashcards` VALUES (1,NULL,'consequently','Do đó, kết quả là','The weather was bad; consequently, the match was cancelled.','Academic Writing Task 1 & 2','IELTS','/ˈkɒnsɪkwənt/','ADJECTIVE','resulting, subsequent, following','IELTS Academic Writing',1,1,NULL,'MEDIUM','2025-06-14 03:48:15','2025-06-14 03:55:22'),(2,NULL,'substantial','Đáng kể, lớn','There has been substantial progress in medical research.','Academic Writing Task 1 & 2','IELTS','/səbˈstænʃəl/','ADJECTIVE','significant, considerable, large','IELTS Academic Writing',1,1,NULL,'MEDIUM','2025-06-14 03:48:15','2025-06-14 03:55:22'),(3,NULL,'demonstrate','Chứng minh, thể hiện','The chart demonstrates a clear upward trend.','Academic Writing Task 1','IELTS','/ˈdemənstreɪt/','VERB','show, illustrate, prove','IELTS Academic Writing',1,1,NULL,'MEDIUM','2025-06-14 03:48:15','2025-06-14 03:55:22'),(4,NULL,'furthermore','Hơn nữa','The statistics show strong growth. Furthermore, this trend is likely to continue.','Academic Writing Task 2','IELTS','/ˈfɜːðəmɔːr/','ADVERB','moreover, additionally, besides','IELTS Academic Writing',1,1,NULL,'MEDIUM','2025-06-14 03:48:15','2025-06-14 03:55:22'),(5,NULL,'estimate','Sự đánh giá, ước lượng','I can give you a rough estimate of the costs.','Academic Writing Task 1','IELTS','/ˈestɪmeɪt/','VERB','calculate, assess, approximate','IELTS Academic Writing',1,1,NULL,'MEDIUM','2025-06-14 03:48:15','2025-06-14 03:57:22'),(6,NULL,'sustainable','Bền vững','We need sustainable solutions to climate change.','Environment & Academic Writing','IELTS','/səˈsteɪnəbəl/','ADJECTIVE','renewable, viable, lasting','IELTS Environment',1,1,NULL,'HARD','2025-06-14 03:48:15','2025-06-14 03:55:22'),(7,NULL,'innovation','Sự đổi mới, cải tiến','Technological innovation has transformed our lives.','Technology & Academic Writing','IELTS','/ˌɪnəˈveɪʃən/','NOUN','invention, creativity, advancement','IELTS Environment',1,1,NULL,'MEDIUM','2025-06-14 03:48:15','2025-06-14 03:55:22'),(8,NULL,'renewab