k 1 & 2','IELTS','/dɪˈveləpmənt/','NOUN','growth, progress, advancement','IELTS Environment',1,1,NULL,'EASY','2025-06-14 03:48:15','2025-06-14 03:55:22'),(16,NULL,'Warrior','Chiến binh','ádasdad','ádasd','IELTS','/ˈwɒɹɪə/','NOUN','ádasd','ád',0,1,NULL,'MEDIUM','2025-06-14 16:07:38','2025-06-14 16:07:38'),(17,5,'computer','Máy tính ','I received a new computer at my 7rd birthday','Normal Day','Basic English','/kəmˈpjuːtə/','NOUN','Laptop','Furniture',1,1,NULL,'EASY','2025-06-19 20:11:32','2025-06-19 20:11:32');
